import React from 'react';
import s from './Item.module.css'
import { NavLink } from 'react-router-dom';
const Item = (props) => {
    return (
        <div className={s.wrapper}>
            <img  className={s.logo} src={props.source} alt=""/>
            <NavLink className={s.operator} to='/operator'>{props.content}</NavLink>
        </div>
            );
        }
export default Item;
